import React, {useState} from "react";

import {  
    IonLabel, 
    IonButton, 
    IonIcon, 
    IonInput,
    IonGrid,
    IonRow,
    IonCol
} from '@ionic/react';

import '@ionic/react/css/flex-utils.css';
import '../assets/css/Custom.css';
import '../assets/css/Responsive.css';
import { Routes } from "../App";

const RentsPayUpcomingTab: React.FC = () => {

    return (
        <div className="tab-content">

            <div className="digi-lease-search-results-box">
                <p>Here is the list of your <b>piad months</b></p>

                <div className="search-result-box">
                    <h3>2020</h3>
                    <IonRow className="">
                        <IonCol size="12" sizeMd="6" className="tenants-lease-info tenants-lease-payment-info ">
                            <IonGrid className="">
                                <IonRow className="">
                                    <IonCol size="6" sizeMd="6" sizeLg="5" className="rent-price-block paid-block">
                                        <p><span>Paid</span>: $900 CAD</p>
                                        <h4>October</h4>
                                        <p>01/11/2021</p>
                                    </IonCol>
                                    <IonCol size="6" sizeMd="6" sizeLg="7" className="rent-period-block">
                                        <IonButton className="secondary-button view-receipt-button"  shape="round" fill="outline">View Receipt</IonButton>
                                    </IonCol>
                                </IonRow>
                            </IonGrid>                                    
                        </IonCol>
                    </IonRow>

                    <IonRow className="ion-justify-content-center">
                        <IonCol size="6" sizeMd="4" sizeLg="4" sizeXl="3" className="">
                            <IonButton className="show-more-button" expand="full" shape="round" fill="solid">More</IonButton>
                        </IonCol>
                    </IonRow>
                </div>

            </div>
            
        </div>
        
        
    );
};

export default RentsPayUpcomingTab;
